import React, { Component } from 'react';
import './Days.css';
import Day from './Day';

class Days extends Component {
  constructor(props) {
            super(props);
            this.state = {
                data: [{
                        date: "",
                        symbol: "",
                        temperature: [],
                },
                  {
                        date: "",
                        symbol: "",
                        temperature: [],
                },
                {
                        date: "",
